    [],nt"num_tags": 2,nt"name": "flyway-habitat-management-unit-project-report-no-6-the-extent-that-migration-and-wintering",nt"isopen":
    false,nt"url": null,nt"notes": "In this report, the results of the first
    comparison is presented. Estimates of the number of waterfowl that migration and
    wintering habitat available in each of 164 management units in the 48 coterminous
    United States could support in 1965 was compared with estimates of the number of
    waterfowl the habitat was called on to support that year. The results indicate where
    habitat-associated problems were located throughout the United States in 1965, using
    the FHMUP approach, and which problems were most serious. This is a first attempt,
    and methods of refining these results and improving the framework for using this
    approach are discussed.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
